import React,{useEffect,useState} from 'react';
import {
    AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
  } from 'recharts';
const axios = require('axios');

function ClientTrackerChart(props) {
    const [trackStats, setTrackStats] = useState([]);
    const [clientId, setClientId] = useState(props.clientId);

    useEffect((props) => {

        const search = window.location.search;
        const params = new URLSearchParams(search);
        const clientUrl = params.get('client');

        //We call the api
        axios.get('http://localhost:8011/client-tracker/tracks-stats/'+clientUrl, {
            headers: {
            }
        }
        ).then(function (response) {

            setTrackStats(response.data);

        }).catch(function (error) {
                // handle error

        }).finally(function () {
                // always executed
        });

    }, []);


    return (
        <>
            <div class='container'>

            <AreaChart width={730} height={250} data={trackStats}
  margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
  <defs>
    <linearGradient id="colorUv" x1="0" y1="0" x2="0" y2="1">
      <stop offset="5%" stopColor="#8884d8" stopOpacity={0.8}/>
      <stop offset="95%" stopColor="#8884d8" stopOpacity={0}/>
    </linearGradient>
    <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
      <stop offset="5%" stopColor="#82ca9d" stopOpacity={0.8}/>
      <stop offset="95%" stopColor="#82ca9d" stopOpacity={0}/>
    </linearGradient>
  </defs>
  <XAxis dataKey="name" />
  <YAxis />
  <CartesianGrid strokeDasharray="3 3" />
  <Tooltip />
  <Area type="monotone" dataKey="value" stroke="#8884d8" fillOpacity={1} fill="url(#colorUv)" />
  <Area type="monotone" dataKey="pv" stroke="#82ca9d" fillOpacity={1} fill="url(#colorPv)" />
</AreaChart>
            </div>
        </>
    );
}

export default ClientTrackerChart;
